// QueryServiceHandler is an implementation of the rill.runtime.v1.QueryService service.
type QueryServiceHandler interface {
	// Query runs a SQL query against the instance's OLAP datastore.
	Query(context.Context, *connect.Request[v1.QueryRequest]) (*connect.Response[v1.QueryResponse], error)
	// Batch request with different queries
	QueryBatch(context.Context, *connect.Request[v1.QueryBatchRequest], *connect.ServerStream[v1.QueryBatchResponse]) error
	// Export builds a URL to download the results of a query as a file.
	Export(context.Context, *connect.Request[v1.ExportRequest]) (*connect.Response[v1.ExportResponse], error)
	// ExportReport builds a URL to download the results of a query as a file.
	ExportReport(context.Context, *connect.Request[v1.ExportReportRequest]) (*connect.Response[v1.ExportReportResponse], error)
	// MetricsViewAggregation is a generic API for running group-by/pivot queries against a metrics view.
	MetricsViewAggregation(context.Context, *connect.Request[v1.MetricsViewAggregationRequest]) (*connect.Response[v1.MetricsViewAggregationResponse], error)
	// Deprecated - use MetricsViewComparison instead.
	// MetricsViewToplist returns the top dimension values of a metrics view sorted by one or more measures.
	// It's a convenience API for querying a metrics view.
	MetricsViewToplist(context.Context, *connect.Request[v1.MetricsViewToplistRequest]) (*connect.Response[v1.MetricsViewToplistResponse], error)
	// MetricsViewComparison returns a toplist containing comparison data of another toplist (same dimension/measure but a different time range).
	// Returns a toplist without comparison data if comparison time range is omitted.
	//
	// ie. comparsion toplist:
	// | measure1_base | measure1_previous   | measure1__delta_abs | measure1__delta_rel | dimension |
	// |---------------|---------------------|---------------------|--------------------|-----------|
	// | 2             | 2                   | 0                   | 0                  | Safari    |
	// | 1             | 0                   | 1                   | N/A                | Chrome    |
	// | 0             | 4                   | -4                  | -1.0               | Firefox   |
	//
	// ie. toplist:
	// | measure1 | measure2 | dimension |
	// |----------|----------|-----------|
	// | 2        | 45       | Safari    |
	// | 1        | 350      | Chrome    |
	// | 0        | 25       | Firefox   |
	MetricsViewComparison(context.Context, *connect.Request[v1.MetricsViewComparisonRequest]) (*connect.Response[v1.MetricsViewComparisonResponse], error)
	// MetricsViewTimeSeries returns time series for the measures in the metrics view.
	// It's a convenience API for querying a metrics view.
	MetricsViewTimeSeries(context.Context, *connect.Request[v1.MetricsViewTimeSeriesRequest]) (*connect.Response[v1.MetricsViewTimeSeriesResponse], error)
	// MetricsViewTotals returns totals over a time period for the measures in a metrics view.
	// It's a convenience API for querying a metrics view.
	MetricsViewTotals(context.Context, *connect.Request[v1.MetricsViewTotalsRequest]) (*connect.Response[v1.MetricsViewTotalsResponse], error)
	// MetricsViewRows returns the underlying model rows matching a metrics view time range and filter(s).
	//
	// ie. without granularity
	// | column1 | column2 | dimension |
	// |---------|---------|-----------|
	// | 2       | 2       | Safari    |
	// | 1       | 0       | Chrome    |
	// | 0       | 4       | Firefox   |
	//
	// ie. with granularity
	// | timestamp__day0      | column1 | column2 | dimension |
	// |----------------------|---------|---------|-----------|
	// | 2022-01-01T00:00:00Z | 2       | 2       | Safari    |
	// | 2022-01-01T00:00:00Z | 1       | 0       | Chrome    |
	// | 2022-01-01T00:00:00Z | 0       | 4       | Firefox   |
	MetricsViewRows(context.Context, *connect.Request[v1.MetricsViewRowsRequest]) (*connect.Response[v1.MetricsViewRowsResponse], error)
	// MetricsViewTimeRange Get the time range summaries (min, max) for time column in a metrics view.
	// Deprecated: use MetricsViewTimeRanges instead.
	MetricsViewTimeRange(context.Context, *connect.Request[v1.MetricsViewTimeRangeRequest]) (*connect.Response[v1.MetricsViewTimeRangeResponse], error)
	// MetricsViewSchema Get the data types of measures and dimensions
	MetricsViewSchema(context.Context, *connect.Request[v1.MetricsViewSchemaRequest]) (*connect.Response[v1.MetricsViewSchemaResponse], error)
	// MetricsViewSearch Get the data types of measures and dimensions
	MetricsViewSearch(context.Context, *connect.Request[v1.MetricsViewSearchRequest]) (*connect.Response[v1.MetricsViewSearchResponse], error)
	// MetricsViewTimeRanges resolves time ranges for a metrics view.
	MetricsViewTimeRanges(context.Context, *connect.Request[v1.MetricsViewTimeRangesRequest]) (*connect.Response[v1.MetricsViewTimeRangesResponse], error)
	MetricsViewAnnotations(context.Context, *connect.Request[v1.MetricsViewAnnotationsRequest]) (*connect.Response[v1.MetricsViewAnnotationsResponse], error)
	// ConvertExpressionToMetricsSQL converts a filter expression to a SQL filter string.
	ConvertExpressionToMetricsSQL(context.Context, *connect.Request[v1.ConvertExpressionToMetricsSQLRequest]) (*connect.Response[v1.ConvertExpressionToMetricsSQLResponse], error)
	// ResolveCanvas is a convenience API that returns a canvas and all its referenced components and metrics views.
	ResolveCanvas(context.Context, *connect.Request[v1.ResolveCanvasRequest]) (*connect.Response[v1.ResolveCanvasResponse], error)
	// ResolveComponent resolves renderer for a Component resource.
	ResolveComponent(context.Context, *connect.Request[v1.ResolveComponentRequest]) (*connect.Response[v1.ResolveComponentResponse], error)
	// ResolveTemplatedString resolves a templated strings.
	ResolveTemplatedString(context.Context, *connect.Request[v1.ResolveTemplatedStringRequest]) (*connect.Response[v1.ResolveTemplatedStringResponse], error)
	// ColumnRollupInterval returns the minimum time granularity (as well as the time range) for a specified timestamp column
	ColumnRollupInterval(context.Context, *connect.Request[v1.ColumnRollupIntervalRequest]) (*connect.Response[v1.ColumnRollupIntervalResponse], error)
	// Get TopK elements from a table for a column given an agg function
	// agg function and k are optional, defaults are count(*) and 50 respectively
	ColumnTopK(context.Context, *connect.Request[v1.ColumnTopKRequest]) (*connect.Response[v1.ColumnTopKResponse], error)
	// Get the number of nulls in a column
	ColumnNullCount(context.Context, *connect.Request[v1.ColumnNullCountRequest]) (*connect.Response[v1.ColumnNullCountResponse], error)
	// Get basic stats for a numeric column like min, max, mean, stddev, etc
	ColumnDescriptiveStatistics(context.Context, *connect.Request[v1.ColumnDescriptiveStatisticsRequest]) (*connect.Response[v1.ColumnDescriptiveStatisticsResponse], error)
	// Estimates the smallest time grain present in the column
	ColumnTimeGrain(context.Context, *connect.Request[v1.ColumnTimeGrainRequest]) (*connect.Response[v1.ColumnTimeGrainResponse], error)
	// Get the histogram for values in a column
	ColumnNumericHistogram(context.Context, *connect.Request[v1.ColumnNumericHistogramRequest]) (*connect.Response[v1.ColumnNumericHistogramResponse], error)
	// Get outliers for a numeric column
	ColumnRugHistogram(context.Context, *connect.Request[v1.ColumnRugHistogramRequest]) (*connect.Response[v1.ColumnRugHistogramResponse], error)
	// Get the time range summaries (min, max) for a column
	ColumnTimeRange(context.Context, *connect.Request[v1.ColumnTimeRangeRequest]) (*connect.Response[v1.ColumnTimeRangeResponse], error)
	// Get cardinality for a column
	ColumnCardinality(context.Context, *connect.Request[v1.ColumnCardinalityRequest]) (*connect.Response[v1.ColumnCardinalityResponse], error)
	// Generate time series for the given measures (aggregation expressions) along with the sparkline timeseries
	ColumnTimeSeries(context.Context, *connect.Request[v1.ColumnTimeSeriesRequest]) (*connect.Response[v1.ColumnTimeSeriesResponse], error)
	// TableCardinality returns row count
	TableCardinality(context.Context, *connect.Request[v1.TableCardinalityRequest]) (*connect.Response[v1.TableCardinalityResponse], error)
	// TableColumns returns column profiles
	TableColumns(context.Context, *connect.Request[v1.TableColumnsRequest]) (*connect.Response[v1.TableColumnsResponse], error)
	// TableRows returns table rows
	TableRows(context.Context, *connect.Request[v1.TableRowsRequest]) (*connect.Response[v1.TableRowsResponse], error)
}

